(function () {

  console.image = function (url, size = 100) {
    const image = new Image();
    image.src = url;
    image.onload = function () {
      let style = [
        'font-size: 1px;',
        'padding: ' + this.height / 100 * size + 'px ' + this.width / 100 * size + 'px;',
        'background: url(' + url + ') no-repeat;',
        'background-size: contain;'
      ].join(' ');
      console.log('%c ', style);
    };
  };

  'use strict';
  let bowie = "data:image/jpeg;base64,"
  Object.defineProperty(Object.prototype, 'toBowie', {
    enumerable: false,
    value: function () {
      console.image(bowie, 50)
    }
  })
})();